const imgSrc =
  "data:image/jpeg;base64,";

export default function PreviousCaptures({ imgs }: { imgs: Array<string> }) {
  const imgTags = imgs.map((src, index) => {
    // normally index's are bad keys but this won't be reordered
    return (
      <div className="flex flex-col gap-6 items-center">
        <img
          className="preview-img object-scale-down max-h-80"
          src={src}
          style={{ border: "1px solid red" }}
          key={index}
        />

        <button className="my-12 text-5xl bg-transparent hover:bg-blue-500 text-blue-700 font-semibold hover:text-white py-4 px-6 border-4 border-blue-500 hover:border-transparent rounded-full">
          Yeti-ize!
        </button>
      </div>
    );
  });

  return <>{imgTags}</>;
}
